import React from 'react';

export default class Cell extends React.Component{
    render(){
        var styleTeste ={
            width:'20px',
            height:'20px'
        };
        return(
            <button 
                style={styleTeste}
                className="cell" 
                onClick={() => this.props.onClick()}
            >
                {this.props.value}
            </button>
        );
    }
}
